"use strict";(self.webpackChunk=self.webpackChunk||[]).push([[18],{68356:(t,e,d)=>{d.r(e),d.d(e,{data:()=>r});const r={key:"v-17254162",path:"/devbook/html/refer/MessageError.html",title:"Message Error",lang:"vi",frontmatter:{},excerpt:"",headers:[{level:2,title:"1xx: Information",slug:"_1xx-information",children:[]},{level:2,title:"2xx: Successful",slug:"_2xx-successful",children:[]},{level:2,title:"3xx: Redirection",slug:"_3xx-redirection",children:[]},{level:2,title:"4xx: Client Error",slug:"_4xx-client-error",children:[]},{level:2,title:"5xx: Server Error",slug:"_5xx-server-error",children:[]}],filePathRelative:"devbook/html/refer/MessageError.md",git:{updatedTime:1630856825e3,contributors:[{name:"Zenfection",email:"44715845+Zenfection1412@users.noreply.github.com",commits:1}]}}},83193:(t,e,d)=>{d.r(e),d.d(e,{default:()=>c});const r=(0,d(66252).uE)('<h1 id="message-error" tabindex="-1"><a class="header-anchor" href="#message-error" aria-hidden="true">#</a> <img src="https://raw.githubusercontent.com/Zenfection/Image/master/2021/07/01-20-19-50-icons8-road_closure.png" alt="icons8-road_closure.png"> Message Error <img src="https://raw.githubusercontent.com/Zenfection/Image/master/2021/06/22-20-49-37-22-12-04-09-06-00-18-00-html5.gif" title="" alt="html5" width="50"></h1><p>Khi trình duyệt gửi tín hiệu về <code>Web server</code>, đôi khi sẽ xuất hiện lỗi, chẳng hạn như <code>404 Not Found</code>.</p><p>Và rất nhiều lỗi mà <code>HTML</code> báo về, dưới đây là tổng hợp các lỗi mà bạn có thể tham khảo :</p><h2 id="_1xx-information" tabindex="-1"><a class="header-anchor" href="#_1xx-information" aria-hidden="true">#</a> <img src="https://raw.githubusercontent.com/Zenfection/Image/master/2021/06/27-22-18-28-icons8-information.png" title="" alt="icons8-information.png" width="40"> 1xx: Information</h2><table><thead><tr><th><img src="https://raw.githubusercontent.com/Zenfection/Image/master/2021/07/01-21-00-10-icons8-messaging.png" alt="icons8-messaging.png"> Message</th><th>Description</th></tr></thead><tbody><tr><td>100 Continue</td><td><code>server</code> nhận <code>request headers</code> và <code>client</code> sẽ tiến hành gửi <code>request</code> đó</td></tr><tr><td>101 Switching Protocols</td><td>Yêu cầu <code>server</code> chuyển đổi <strong>giao thức</strong> (<code>protocols</code>)</td></tr><tr><td>103 Checkpoint</td><td>Được sử dụng trong đề xuất có thể tiếp tục yêu cầu <code>PUT</code> <em>hoặc</em> <code>POST</code> đã bị huỷ bỏ</td></tr></tbody></table><hr><h2 id="_2xx-successful" tabindex="-1"><a class="header-anchor" href="#_2xx-successful" aria-hidden="true">#</a> <img src="https://raw.githubusercontent.com/Zenfection/Image/master/2021/06/27-22-17-39-icons8-system_information.png" title="" alt="icons8-system_information.png" width="40"> 2xx: Successful</h2><table><thead><tr><th><img src="https://raw.githubusercontent.com/Zenfection/Image/master/2021/07/01-21-00-10-icons8-messaging.png" alt="icons8-messaging.png"> Message</th><th>Description</th></tr></thead><tbody><tr><td>200 OK</td><td><code>Request</code> thành công (<em>phản hồi thành công <code>HTTP request</code></em>)</td></tr><tr><td>201 Created</td><td><code>Request</code> được thực hiện và <code>resource</code> mới đã được tạo</td></tr><tr><td>202 Accept</td><td><code>Request</code> được chấp nhận xử lý (<em>quá trình xử lý chưa hoàn thành</em>)</td></tr><tr><td>203 Non-Authoritative Information</td><td><code>Request</code> được xử lý thành công nhưng trả lại thông tin từ một <code>source</code> khác</td></tr><tr><td>204 No Content</td><td><code>Request</code> được xử lý thành công nhưng không trả về nội dung nào</td></tr><tr><td>205 Reset Content</td><td><code>Request</code> được xử lý thành công nhưng không trả về nội dung nào, và <code>request</code> được yêu cầu đặt chế độ <code>document view</code></td></tr><tr><td>206 Partial Content</td><td><code>Server</code> phân phối một phần <code>resource</code> do phạm vi <code>header</code> gửi bởi <code>client</code></td></tr></tbody></table><hr><h2 id="_3xx-redirection" tabindex="-1"><a class="header-anchor" href="#_3xx-redirection" aria-hidden="true">#</a> <img src="https://raw.githubusercontent.com/Zenfection/Image/master/2021/06/27-22-19-05-icons8-train_track.png" title="" alt="icons8-train_track.png" width="40"> 3xx: Redirection</h2><table><thead><tr><th><img src="https://raw.githubusercontent.com/Zenfection/Image/master/2021/07/01-21-00-10-icons8-messaging.png" alt="icons8-messaging.png"> Message</th><th>Description</th></tr></thead><tbody><tr><td>300 Multiple Choices</td><td>Một danh sách <code>link</code>, người dùng có thể chọn <code>link</code> và tới đó (<em>tối đa <code>5</code> link</em>)</td></tr><tr><td>301 Moved Permanently</td><td>Trang yêu cầu chuyển qua <code>URL</code> mới</td></tr><tr><td>302 Found</td><td>Trang yêu cầu <strong>tạm thời</strong> chuyển qua <code>URL</code> <strong>mới</strong></td></tr><tr><td>303 See Other</td><td>Trang yêu cầu có thể tìm thấy dưới một <code>URL</code> <strong>khác</strong></td></tr><tr><td>304 Not Modified</td><td>Chỉ ra trang yêu cầu chưa sửa đổi kể từ lần <code>request</code> cuối cùng</td></tr><tr><td>307 Temporary</td><td>Trang yêu cầu đã tạm thời chuyển sang <code>URL</code> <strong>mới</strong></td></tr><tr><td>308 Resume Incomplete</td><td>Được sử dụng trong đề xuất <code>request proposal</code> để yêu cầu <code>PUT</code> <em>hoặc</em> <code>POST</code> đã bị huỷ bỏ</td></tr></tbody></table><hr><h2 id="_4xx-client-error" tabindex="-1"><a class="header-anchor" href="#_4xx-client-error" aria-hidden="true">#</a> <img src="https://raw.githubusercontent.com/Zenfection/Image/master/2021/06/27-22-19-26-icons8-error_cloud.png" title="" alt="icons8-error_cloud.png" width="40"> 4xx: Client Error</h2><table><thead><tr><th><img src="https://raw.githubusercontent.com/Zenfection/Image/master/2021/07/01-21-00-10-icons8-messaging.png" alt="icons8-messaging.png"> Message</th><th>Description</th></tr></thead><tbody><tr><td>400 Bad Request</td><td>Không thể thực hiện do cú pháp sai</td></tr><tr><td>401 Unauthorized</td><td><code>Request</code> đúng nhưng <code>server</code> từ chối phản hồi<br>Dùng khi có thể xác thực nhưng thất bại hoặc chưa được cung cấp</td></tr><tr><td>403 Forbidden</td><td><code>Request</code> đúng nhưng <code>server</code> từ chối phản hồi</td></tr><tr><td>404 Not Found</td><td>Trang yêu cầu có thể không tìm thấy <em>hoặc</em> có thể không khả dụng nữa</td></tr><tr><td>405 Method Not Allowed</td><td><code>Request</code> được tạo bằng một trang sử dụng phương thức <code>request</code> không hỗ trợ trên trang</td></tr><tr><td>406 Not Acceptable</td><td><code>Server</code> có thể tạo phản hồi mà <code>client</code> không chấp nhận</td></tr><tr><td>407 Proxy Authentication</td><td><code>Client</code> buộc phải tự xác thực bằng <code>proxy</code></td></tr><tr><td>408 Request Timeout</td><td><code>Server</code> hết thời gian đợi <code>request</code></td></tr><tr><td>409 Conflict</td><td><code>Request</code> có thể không hoàn thành vì có xung đột trong <code>request</code></td></tr><tr><td>410 Gone</td><td>Trang <code>request</code> không còn nữa</td></tr><tr><td>411 Length Required</td><td><code>&quot;Content-Length&quot;</code> không xác định. <code>Server</code> không chấp nhận <code>request</code> nếu không có nó</td></tr><tr><td>412 Precodition Failed</td><td>Điều kiện tiên quyết đưa ra <code>request</code> là <em>false</em> bên phía <code>server</code></td></tr><tr><td>413 Request Entity Too Large</td><td><code>Server</code> sẽ không chấp nhận <code>request</code> vì <code>request entity</code> quá dài</td></tr><tr><td>414 Request-URI Too Long</td><td><code>Server</code> sẽ không chấp nhận <code>request</code>, vì <code>URL</code> <em>quá dài</em>. Xảy ra khi bạn chuyển <code>POST request</code> sang <code>GET request</code> với thông tin truy vấn dài</td></tr><tr><td>415 Unsupported Media Type</td><td><code>Server</code> sẽ không chấp nhận <code>request</code> vì kiểu tập tin <em>không hỗ trợ</em></td></tr><tr><td>416 Requested Range Not Satisfiable</td><td><code>Client</code> yêu cầu một phần của <code>file</code>, nhưng <code>server</code> không thể cung cấp phần đó</td></tr><tr><td>417 Expectation Failed</td><td><code>Server</code> không thể đáp ứng yêu cầu của trường <code>Except request-header</code></td></tr></tbody></table><hr><h2 id="_5xx-server-error" tabindex="-1"><a class="header-anchor" href="#_5xx-server-error" aria-hidden="true">#</a> <img src="https://raw.githubusercontent.com/Zenfection/Image/master/2021/06/27-22-20-16-icons8-smart_home_error.png" title="" alt="icons8-smart_home_error.png" width="40"> 5xx: Server Error</h2><table><thead><tr><th><img src="https://raw.githubusercontent.com/Zenfection/Image/master/2021/07/01-21-00-10-icons8-messaging.png" alt="icons8-messaging.png"> Message</th><th>Description</th></tr></thead><tbody><tr><td>500 Internal Server Error</td><td>Lỗi chung chung, vì không biết lỗi nào phù hợp</td></tr><tr><td>501 Not Implemented</td><td><code>Server</code> không nhận ra <code>request method</code> hoặc thiếu khả năng đáp ứng <code>request</code></td></tr><tr><td>502 Bad Gateway</td><td><code>Server</code> hoạt động như một <code>gateway</code> <em>hoặc</em> <code>proxy</code> và nhận các phản hồi không hợp lệ từ <code>upstream server</code></td></tr><tr><td>503 Service Unavailable</td><td><code>Server</code> hiện tại không khả dụng</td></tr><tr><td>504 Gateway Timeout</td><td><code>Server</code> hoạt động như một <code>gateway</code> <em>hoặc</em> <code>proxy</code> và không nhận phản hồi kịp thời từ <code>upstream server</code></td></tr><tr><td>505 HTTP Version Not Supported</td><td><code>Server</code> <em>không hỗ trợ</em> phiên bản giao thức <code>HTTP</code> được sử dụng trong <code>request</code></td></tr><tr><td>511 Network Authentication Required</td><td><code>Client</code> cần xác thực để có quyền truy cập mạng</td></tr></tbody></table>',17),c={render:function(t,e){return r}}}}]);